BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "data" (
	"Timestamp"	TEXT,
	"Email"	TEXT,
	"Name"	TEXT,
	"Year"	INTEGER,
	"Make"	TEXT,
	"Model"	TEXT,
	"Car_ID"	INTEGER,
	"Judge_ID"	TEXT,
	"Judge_Name"	TEXT,
	"Racer_Turbo"	INTEGER,
	"Racer_Supercharged"	INTEGER,
	"Racer_Performance"	INTEGER,
	"Racer_Horsepower"	INTEGER,
	"Car_Overall"	INTEGER,
	"Engine_Modifications"	INTEGER,
	"Engine_Performance"	INTEGER,
	"Engine_Chrome"	INTEGER,
	"Engine_Detailing"	INTEGER,
	"Engine_Cleanliness"	INTEGER,
	"Body_Frame_Undercarriage"	INTEGER,
	"Body_Frame_Suspension"	INTEGER,
	"Body_Frame_Chrome"	INTEGER,
	"Body_Frame_Detailing"	INTEGER,
	"Body_Frame_Cleanliness"	INTEGER,
	"Mods_Paint"	INTEGER,
	"Mods_Body"	INTEGER,
	"Mods_Wrap"	INTEGER,
	"Mods_Rims"	TEXT,
	"Mods_Interior"	INTEGER,
	"Mods_Other"	INTEGER,
	"Mods_ICE"	INTEGER,
	"Mods_Aftermarket"	INTEGER,
	"Mods_WIP"	INTEGER,
	"Mods_Overall"	INTEGER
);
CREATE TABLE IF NOT EXISTS "cars" (
	"Timestamp"	TEXT,
	"Email"	TEXT,
	"Name"	TEXT,
	"Year"	INT,
	"Make"	TEXT,
	"Model"	TEXT,
	"Car_ID"	INT
);
CREATE TABLE IF NOT EXISTS "judges" (
	"Judge_ID"	TEXT,
	"Judge_Name"	TEXT
);
CREATE TABLE IF NOT EXISTS "car_score" (
	"Racer_Turbo"	INT,
	"Racer_Supercharged"	INT,
	"Racer_Performance"	INT,
	"Racer_Horsepower"	INT,
	"Car_Overall"	INT,
	"Engine_Performance"	INT,
	"Engine_Modifications"	INT,
	"Engine_Detailing"	INT,
	"Engine_Cleanliness"	INT,
	"Engine_Chrome"	INT,
	"Body_Frame_Chrome"	INT,
	"Body_Frame_Cleanliness"	INT,
	"Body_Frame_Detailing"	INT,
	"Body_Frame_Suspension"	INT,
	"Body_Frame_Undercarriage"	INT,
	"Mods_Aftermarket"	INT,
	"Mods_Body"	INT,
	"Mods_ICE"	INT,
	"Mods_Interior"	INT,
	"Mods_Other"	INT,
	"Mods_Paint"	INT,
	"Mods_Rims"	TEXT,
	"Mods_WIP"	INT,
	"Mods_Wrap"	INT,
	"Mods_Overall"	INT,
	"Car_ID"	INT,
	"Judge_ID"	TEXT
);
CREATE TABLE IF NOT EXISTS "ranks" (
	"Car_ID"	INTEGER,
	"Year"	INTEGER,
	"Car_Make"	INTEGER,
	"Car_Model"	INTEGER,
	"totals"	INTEGER,
	"ranking"	INTEGER,
	PRIMARY KEY("ranking" AUTOINCREMENT)
);
COMMIT;
